utions_right_side_content_1_right_side_inner_content','field_639b7cac3a97c'),(10041,2,'builder_3_solutions_right_side_content_1_right_side_inner_icon','139'),(10042,2,'_builder_3_solutions_right_side_content_1_right_side_inner_icon','field_639b7cb23a97d'),(10043,2,'builder_3_solutions_right_side_content_2_right_side_inner_content','<div>\r\n<div><strong>Insights, Alerts and Data to Pharma</strong></div>\r\n<ul class=\"small pl-3\">\r\n 	<li>Curated Pharma Info to Doctor</li>\r\n 	<li>MDR and Decision Alerts - Real-Time</li>\r\n 	<li>Oncologist Decision Process</li>\r\n</ul>\r\n</div>'),(10044,2,'_builder_3_solutions_right_side_content_2_right_side_inner_content','field_639b7cac3a97c'),(10045,2,'builder_3_solutions_right_side_content_2_right_side_inner_icon','172'),(10046,2,'_builder_3_solutions_right_side_content_2_right_side_inner_icon','field_639b7cb23a97d'),(10047,2,'builder_3_solutions_right_side_content','3'),(10048,2,'_builder_3_solutions_right_side_content','field_639b798c94ccb'),(10049,2,'builder_3_solutions',''),(10050,2,'_builder_3_solutions','field_639b78e394cc9'),(10051,2,'builder_5_content_image_background_image','58'),(10052,2,'_builder_5_content_image_background_image','field_639a1cb53db08'),(10053,2,'builder_5_content_image_image_side','Left'),(10054,2,'_builder_5_content_image_image_side','field_639a20d0749c7'),(10055,2,'builder_5_content_image_style',''),(10056,2,'_builder_5_content_image_style','field_639a1cd83db09'),(10057,2,'builder_5_content_image_classes',''),(10058,2,'_builder_5_content_image_classes','field_639a1ce53db0a'),(10059,2,'builder_5_content_image_content_column_style',''),(10060,2,'_builder_5_content_image_content_column_style','field_639a24c36d71c'),(10061,2,'builder_5_content_image_content_column_classes','col-lg-6'),(10062,2,'_builder_5_content_image_content_column_classes','field_639a24d36d71d'),(10063,2,'builder_5_content_image_content','<h6>Evolution</h6>\r\n[divider]\r\n<h2>OUR VALUE</h2>\r\n<strong>ONCOLOGISTS</strong>\r\n<ul>\r\n 	<li>One portal for diagnostic reports, active links to research and trials</li>\r\n 	<li>Prescribed most effective and efficient treatment</li>\r\n 	<li>Collaborative, asynchronous, secure consults</li>\r\n 	<li>Create a new stream of income</li>\r\n</ul>\r\n<strong>PHARMA</strong>\r\n<ul>\r\n 	<li>Intelligence from an oncologist\'s treatment decision process</li>\r\n 	<li>Real-time alerts of molecular matches and precisely targeted marketing</li>\r\n 	<li>Patient outcomes by molecular profile and prescribed drugs</li>\r\n 	<li>Improved drug targeting due to tracking of patient outcomes</li>\r\n</ul>'),(10064,2,'_builder_5_content_image_content','field_639a1d153db0b'),(10065,2,'builder_5_content_image_image','83'),(10066,2,'_builder_5_content_image_image','field_639a1d1c3db0c'),(10067,2,'builder_5_content_image_link',''),(10068,2,'_builder_5_content_image_link','field_639a23d5193d4'),(10069,2,'builder_5_content_image',''),(10070,2,'_builder_5_content_image','field_639a1c8a3db07'),(10071,2,'builder_6_posts_content','<h2>News</h2>'),(10072,2,'_builder_6_posts_content','field_639a270a8d09f'),(10073,2,'builder_6_posts_posts','a:2:{i:0;s:3:\"168\";i:1;s:3:\"200\";}'),(10074,2,'_builder_6_posts_posts','field_639a27148d0a0'),(10075,2,'builder_6_posts',''),(10076,2,'_builder_6_posts','field_639a26c78d09e'),(10077,2,'builder_7_testimonials_group_testimonials_content_title','TESTIMONIALS'),(10078,2,'_builder_7_testimonials_group_testimonials_content_title','field_61605c5dc91b2'),(10079,2,'builder_7_testimonials_group_testimonials_content_content',''),(10080,2,'_builder_7_testimonials_group_testimonials_content_content','field_61605bf9122d9'),(10081,2,'builder_7_testimonials_group_testimonials_content',''),(10082,2,'_builder_7_testimonials_group_testimonials_content','field_640a1f0d88370_field_61605bec122d8'),(10083,2,'builder_7_testimonials_group_testimonials_repeater_0_content','The OncoRx Insights platform enables â€œone stop shopping\" by presenting molecular diagnostic reports from different labs in a common, easily understood format, and integrates the reports and real-time research in one place. The product helps oncologists be more efficient with our time and treatment recommendations. Also, we can use the platform to securely communicate with colleagues regarding NGS reports.'),(10084,2,'_builder_7_testimonials_group_testimonials_repeater_0_content','field_5fce74d0375fd'),(10085,2,'builder_7_testimonials_group_testimonials_repeater_0_name','Dr. Judah Friedman'),(10086,2,'_builder_7_testimonials_group_testimonials_repeater_0_name','field_5fce74e6375fe'),(10087,2,'builder_7_testimonials_group_testimonials_repeater_0_job_title','Medical Oncologist, Florida Cancer Specialists'),(10088,2,'_builder_7_testimonials_group_testimonials_repeater_0_job_title','field_5fce74ed375ff'),(10089,2,'builder_7_testimonials_group_testimonials_repeater_1_content','Next generation sequencing reports are long, dense, and complicated. OncoRx Insights translates key findings into easily consumed visuals. This simplifies decisions on potential treatments, indications, side effects and dose modifications. The result? Improved, evidence-based care â€“ and time saved.'),(10090,2,'_builder_7_testimonials_group_testimonials_repeater_1_content','field_5fce74d0375fd'),(10091,2,'builder_7_testimonials_group_testimonials_repeater_1_name','Dr. Wilson Mertens'),(10092,2,'_builder_7_testimonials_group_testimonials_repeater_1_name','field_5fce74e6375fe'),(10093,2,'builder_7_testimonials_group_testimonials_repeater_1_job_title','Medical Oncologist, Baystate Medical'),(10094,2,'_builder_7_testimonials_group_testimonials_repeater_1_job_title','field_5fce74ed375ff'),(10095,2,'builder_7_testimonials_group_testimonials_repeater_2_content','The Holy Grail in my world has been understanding the patient journey so that we can solve for whatever issues patients are having along the way. Thereâ€™s a lot of value there.'),(10096,2,'_builder_7_testimonials_group_testimonia