 Customer Group, with responsibility for pricing and contracting of over $12Bn of J&J Pharmaceutical sales.'),(10274,202,'_builder_2_leadership_group_team_member_1_bio','field_648b6e0a6fd3b'),(10275,202,'builder_2_leadership_group_team_member_2_headshot','271'),(10276,202,'_builder_2_leadership_group_team_member_2_headshot','field_648b6df16fd39'),(10277,202,'builder_2_leadership_group_team_member_2_name','Dr. Jeffrey Bailet'),(10278,202,'_builder_2_leadership_group_team_member_2_name','field_648b6df86fd3a'),(10279,202,'builder_2_leadership_group_team_member_2_bio','Dr. Jeff Bailet recently retired as the president & chief executive officer at Altais, a start-up focused on helping physicians and the clinical community maximize the health and well-being of their patients in a way that is sustainably affordable and maintains professional gratification.'),(10280,202,'_builder_2_leadership_group_team_member_2_bio','field_648b6e0a6fd3b'),(10281,202,'builder_2_leadership_group_team_member_3_headshot','264'),(10282,202,'_builder_2_leadership_group_team_member_3_headshot','field_648b6df16fd39'),(10283,202,'builder_2_leadership_group_team_member_3_name','Dr. Judah Friedman'),(10284,202,'_builder_2_leadership_group_team_member_3_name','field_648b6df86fd3a'),(10285,202,'builder_2_leadership_group_team_member_3_bio','Dr. Friedman is a co-founder and our Chief Medical Officer. He is a Board-certified oncologist in Medical Oncology, Hematology and Internal Medicine with Florida Cancer Specialists. He received his medical degree from Case Western Reserve University and completed Internal Medicine residency training at Washington University School of Medicine Barnes-Jewish Hospital, and a fellowship in Hematology/Oncology at the University of Michigan. Previously, he served in a variety of positions with University Hospitals of Cleveland Seidman Cancer Center and has been actively involved in clinical research.'),(10286,202,'_builder_2_leadership_group_team_member_3_bio','field_648b6e0a6fd3b'),(10287,202,'builder_2_leadership_group_team_member_4_headshot','267'),(10288,202,'_builder_2_leadership_group_team_member_4_headshot','field_648b6df16fd39'),(10289,202,'builder_2_leadership_group_team_member_4_name','Dr. Jim Costello'),(10290,202,'_builder_2_leadership_group_team_member_4_name','field_648b6df86fd3a'),(10291,202,'builder_2_leadership_group_team_member_4_bio','Dr. Costello is a co-founder and our Chief Science Officer.  He is also an Associate Professor of Pharmacology at the University of Colorado Anschutz Medical Campus. He is also the Co-Director of the Biostatistics and Bioinformatics Shared Resource through the University of Colorado Cancer Center and Co-Director of the Pharmacology PhD Training Program. Dr. Costello studies the molecular features that drive aggressiveness in prostate cancer and the molecular mechanisms that drive therapeutic resistance in bladder cancer. His research lab also develops computational models to integrate multi-omics datasets, predict novel drug targets, and characterize pathway-specific effects from transcriptomic datasets.'),(10292,202,'_builder_2_leadership_group_team_member_4_bio','field_648b6e0a6fd3b'),(10293,202,'builder_2_leadership_group_team_member','5'),(10294,202,'_builder_2_leadership_group_team_member','field_648b6de86fd38'),(10295,202,'builder_2_leadership_group',''),(10296,202,'_builder_2_leadership_group','field_648b6d5b2fd73'),(10363,202,'builder_1_leadership_group_column_classes','col-lg-12 text-center pb-5'),(10364,202,'_builder_1_leadership_group_column_classes','field_648b6ec737a9e_field_642452af4b3d5'),(10365,202,'builder_1_leadership_group_column_style',''),(10366,202,'_builder_1_leadership_group_column_style','field_648b6ec737a9e_field_642452c34b3d6'),(10367,202,'builder_1_leadership_group_content','[divider]\r\n<h2>LEADERSHIP</h2>'),(10368,202,'_builder_1_leadership_group_content','field_648b6ec737a9e_field_642452df4b3d7'),(10369,202,'builder_1_leadership_group_team_member_0_head