ontent','field_639a270a8d09f'),(10553,2,'builder_8_posts_posts','a:2:{i:0;s:3:\"168\";i:1;s:3:\"200\";}'),(10554,2,'_builder_8_posts_posts','field_639a27148d0a0'),(10555,2,'builder_8_posts',''),(10556,2,'_builder_8_posts','field_639a26c78d09e'),(10557,2,'builder_9_testimonials_group_testimonials_content_title','TESTIMONIALS'),(10558,2,'_builder_9_testimonials_group_testimonials_content_title','field_61605c5dc91b2'),(10559,2,'builder_9_testimonials_group_testimonials_content_content',''),(10560,2,'_builder_9_testimonials_group_testimonials_content_content','field_61605bf9122d9'),(10561,2,'builder_9_testimonials_group_testimonials_content',''),(10562,2,'_builder_9_testimonials_group_testimonials_content','field_640a1f0d88370_field_61605bec122d8'),(10563,2,'builder_9_testimonials_group_testimonials_repeater_0_content','The OncoRx Insights platform enables â€œone stop shopping\" by presenting molecular diagnostic reports from different labs in a common, easily understood format, and integrates the reports and real-time research in one place. The product helps oncologists be more efficient with our time and treatment recommendations. Also, we can use the platform to securely communicate with colleagues regarding NGS reports.'),(10564,2,'_builder_9_testimonials_group_testimonials_repeater_0_content','field_5fce74d0375fd'),(10565,2,'builder_9_testimonials_group_testimonials_repeater_0_name','Dr. Judah Friedman'),(10566,2,'_builder_9_testimonials_group_testimonials_repeater_0_name','field_5fce74e6375fe'),(10567,2,'builder_9_testimonials_group_testimonials_repeater_0_job_title','Medical Oncologist, Florida Cancer Specialists'),(10568,2,'_builder_9_testimonials_group_testimonials_repeater_0_job_title','field_5fce74ed375ff'),(10569,2,'builder_9_testimonials_group_testimonials_repeater_1_content','Next generation sequencing reports are long, dense, and complicated. OncoRx Insights translates key findings into easily consumed visuals. This simplifies decisions on potential treatments, indications, side effects and dose modifications. The result? Improved, evidence-based care â€“ and time saved.'),(10570,2,'_builder_9_testimonials_group_testimonials_repeater_1_content','field_5fce74d0375fd'),(10571,2,'builder_9_testimonials_group_testimonials_repeater_1_name','Dr. Wilson Mertens'),(10572,2,'_builder_9_testimonials_group_testimonials_repeater_1_name','field_5fce74e6375fe'),(10573,2,'builder_9_testimonials_group_testimonials_repeater_1_job_title','Medical Oncologist, Baystate Medical'),(10574,2,'_builder_9_testimonials_group_testimonials_repeater_1_job_title','field_5fce74ed375ff'),(10575,2,'builder_9_testimonials_group_testimonials_repeater_2_content','The Holy Grail in my world has been understanding the patient journey so that we can solve for whatever issues patients are having along the way. Thereâ€™s a lot of value there.'),(10576,2,'_builder_9_testimonials_group_testimonials_repeater_2_content','field_5fce74d0375fd'),(10577,2,'builder_9_testimonials_group_testimonials_repeater_2_name','Brian Duda'),(10578,2,'_builder_9_testimonials_group_testimonials_repeater_2_name','field_5fce74e6375fe'),(10579,2,'builder_9_testimonials_group_testimonials_repeater_2_job_title','VP North America Market Access, Acceleron/Merck'),(10580,2,'_builder_9_testimonials_group_testimonials_repeater_2_job_title','field_5fce74ed375ff'),(10581,2,'builder_9_testimonials_group_testimonials_repeater','3'),(10582,2,'_builder_9_testimonials_group_testimonials_repeater','field_640a1f0d88370_field_5fce74c6375fc'),(10583,2,'builder_9_testimonials_group',''),(10584,2,'_builder_9_testimonials_group','field_640a1efb8836f'),(10585,2,'builder_10_layout','Content Center'),(10586,2,'_builder_10_layout','field_639a07d5f859d'),(10587,2,'builder_10_content_center_classes',''),(10588,2,'_builder_10_content_center_classes','field_64245445e8461_field_63c58e1babc15'),(10589,2,'builder_10_content_center_style','padding-top:500px!important;'),(10590,2,'_builder_10_content_center_style','